import React, { Component } from 'react';
import { StyleSheet, View, Text, ScrollView } from 'react-native';

class ShowReviews extends Component {

    // componentDidMount(){
    //     this.props.fetchReviews();
    //   }

    render(){
        return (
            <ScrollView>
            <View style={styles.reviews}>
                <Text style={styles.reviewsdiscp}>
                    All Reviews
                </Text>
                <View style={styles.review}>
                    <Text style={styles.reviewReview}>Review</Text>
                    <Text style={styles.reviewName}>-By name</Text>
                </View>
                <View style={styles.review}>
                    <Text style={styles.reviewReview}>Review</Text>
                    <Text style={styles.reviewName}>-By name</Text>
                </View>
            </View>
            </ScrollView>
        );
    }

}

const styles = StyleSheet.create({
  reviews: {
    width: "100%",
    alignItems: "center",
    justifyContent: "center",
    // backgroundColor: "#eee",
    marginTop: 15
  },
  reviewsdiscp: {
    // width: '70%',
    padding: 5,
    fontSize: 22,
    fontWeight: 'bold',
    marginBottom: 5
  },
  review: {
    width: '80%',
    padding: 8,
    // fontSize: 18,
    borderWidth: 1.5,
    borderColor: "#ddd",
    backgroundColor: '#eee',
    borderRadius: 10,
    marginBottom: 10
  },
  reviewReview: {
    fontSize: 18,
    color: '#3D3C3A'
  },
  reviewName: {
    fontSize: 15,
    color: '#6D6968'
  }
});

export default ShowReviews;
